import React from 'react';

export default class Log extends React.Component {
  state = {
    name1: '',
    name2: '',
  };
  changeTitle = (ev) => {
    this.setState({ name1: ev.target.value });
  };
  changeTitlee = (eve) => {
    this.setState({ name2: eve.target.value });
  };

  Ren = (evw) => {
    evw.preventDefault();
    this.props.Ren(this.state.name1);
    this.props.Ren(this.state.name2);
  };

  render() {
    return (
      <form onSubmit={this.Ren}>
        <input type='email' placeholder='Email' onChange={this.changeTitlee} />
        <input
          type='password'
          placeholder='Password'
          minLength='6'
          onChange={this.changeTitle}
        />
        <button>
          <b> Login in</b>
        </button>
      </form>
    );
  }
}
